      <div className="container">
        <div className="row">
          <Col lg={12}>
            <input
              id="searchInput"
              type="text"
              placeholder="Search here..."
              className="search-input"
              value={searchTerm}
              onChange={(event) => {
                setSearchTerm(event.target.value);
              }}
            />
          </Col>
        </div>
      </div>
    </div>
  );
}

